syntax = "proto3";
package pb;
option go_package = "github.com/Azure/azure-container-networking/npm/pkg/transport/pb;pb";

import "google/protobuf/struct.proto";

service GRPCDataplane {
	rpc CreateIPSets(ListValue) returns (NilResponse);
}

message ListValue {
	repeated google.protobuf.Struct values = 1;
}

message NilResponse {};